  height: max-content; 
  padding-top: 1%; 
  padding-bottom: 10%;
  padding: 0px;
  margin: 0px;

  `
  const Button = styled.div `
  background: #67C0DC;
  `



export const Home = () => {

    return (
        <div>
            <Header />
            <CorStyled>

            </CorStyled>
            <Button onClick={() => irParaPokedex(navigate)}>Pokedex</Button>


